import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { CarserviceService } from '../carservice.service';

@Component({
  selector: 'app-carsize',
  templateUrl: './carsize.component.html',
  styleUrls: ['./carsize.component.css']
})
export class CarsizeComponent implements OnInit {

  listOfCars = [
    {
      "IsChecked": false,
      "CarImage": "data:image/jpeg;base64,",
      "CarName": "Sedan"
    },
    {
      "IsChecked": false,
      "CarImage": "data:image/jpeg;base64,",
      "CarName": "Hyundai Creta"
    },
    {
      "IsChecked": false,
      "CarImage": "data:image/jpeg;base64,",
      "CarName": "Suzuki"
    }
  ]
  saveSelectedCars = [];
  AlertMessage: string;
  FailureMessage: boolean;

  constructor(private router: Router, public carservice: CarserviceService) { }

  ngOnInit(): void {
    if (sessionStorage.getItem("SetAllCardValues")) {
      this.listOfCars = JSON.parse(sessionStorage.getItem("SetAllCardValues"));
    }
  }

  // method to select car size

  selectCar(event, index) {
    if (event.target.checked) {
      this.listOfCars[index].IsChecked = event.target.checked;
    }
    sessionStorage.setItem("SetAllCardValues", JSON.stringify(this.listOfCars));
    this.carservice.arr = this.listOfCars;
  }

  // method to save selected car size
  
  selectedCar() {
    this.listOfCars.forEach(element => {
      if (element.IsChecked == true) {
        this.saveSelectedCars.push(element);
      }
      sessionStorage.setItem("SaveSelectedCars", JSON.stringify(this.saveSelectedCars));
    })
    if (this.saveSelectedCars.length == 0) {
      this.AlertMessage = "Please choose car type to continue."
      this.FailureMessage = true;
      setTimeout(() => {
        this.FailureMessage = false;
      }, 5000);
    }
    else {
      var modal = document.getElementById('confirmCarSelection');
      modal.style.display = "block";
    }
  }

  failureClose() {
    this.FailureMessage = true;
  }

  closePopUp() {
    var modal = document.getElementById('confirmCarSelection');
    modal.style.display = "none";
    this.router.navigate(["/price"]);
  }

}
